import React from 'react';

import styled from 'styled-components';

import {
  ViewerSettingItemStyle,
  ViewerSettingValueStyle,
  ViewerSettingLabelStyle,
} from '../../styles/viewer';
import { subColor } from '../../styles';

const Container = styled.div`
  ${ViewerSettingItemStyle}
`;

const Label = styled.div`
  ${ViewerSettingLabelStyle}
`;

const Value = styled.div`
  ${ViewerSettingValueStyle}
`;

const Controller = styled.div`
  display: flex;
  width: 30%;
  margin: auto 0 auto auto;
  border: 1px solid ${subColor};
  border-radius: 1em;
  padding-left: .3em;
  padding-right: .3em;
`;

const MinusButton = styled.div`
  width: 50%;
  cursor: pointer;
  border-right: 1px solid ${subColor}
`;

const PlusButton = styled.div`
  width: 50%;
  cursor: pointer;
`;

interface Props {
  label: string;
  value: number | string;
  colors: string[];
  action: (param: string | number) => void;
}

const ViewerSettingColorItem: React.FunctionComponent<Props> = ({
  label, value, colors, action,
}) => (
  <Container>
    <Label>
      {label}
    </Label>
    <Value>
      {value}
    </Value>
    <Controller />
  </Container>
);

export default ViewerSettingColorItem;
